import 'package:flutter/material.dart';import 'package:library_reservation/ui/pages/home/home_page.dart';import 'package:library_reservation/ui/pages/webview/setting_page.dart';import '../../sc_my_app.dart';class XBRouter {  // static final String initialRoute = SCMainPage.routeString;  static final String initialRoute = SCMyApp.routeString;  static final Map<String ,WidgetBuilder> routes = {    //ScMa    SCMyApp.routeString : (ctx) => SCMyApp(),   // ScanPage.routeString :(ctx) => ScanPage(),    //SCCodeDialogWidget.routeString : (ctx) => SCCodeDialogWidget(),    SettingPage.routeString : (ctx) => SettingPage(),  };  static final RouteFactory generateRoute = (settings) {    final String? name = settings.name;    final Function pageContentBuilder = routes[name] as Function;    if (pageContentBuilder != null) {      if (settings.arguments != null) {        final Route route = MaterialPageRoute(            builder: (context) =>                pageContentBuilder(context, arguments: settings.arguments));        return route;      }    } else {      final Route route =      MaterialPageRoute(builder: (context) => pageContentBuilder(context));      return route;    }  };  static final RouteFactory unknownRoute = (settings) {    return null;  };}